//import Java Excel API Library
import jxl.*
import jxl.write.*
//Defining the variables
def TestCase = context.testCase
def FilePath = "C:\\Users\\PrathimaR\\Desktop\\Upskill\\API Testing\\Test Data\\TC_008.xls"
def count
//Selecting the workbook and the sheet in the workbook
Workbook WorkBook1 = Workbook.getWorkbook(new File(FilePath))
Sheet Sheet1 = WorkBook1.getSheet(0)
//Property sheet has to be considered
PropertiesTestStep = TestCase.getTestStepByName("Properties")
//Calling the counter property
count = PropertiesTestStep.getPropertyValue("counter").toInteger()

//If total records is unknown, get row count from Excel
if (PropertiesTestStep.getPropertyValue("total").toString() =="")
   PropertiesTestStep.setPropertyValue("total",Sheet1.getRows().toString())
count++   

//Read the data from excel
Cell Field1 = Sheet1.getCell(0, count)
Cell Field2 = Sheet1.getCell(1, count)
Cell Field3 = Sheet1.getCell(2, count)
Cell Field4 = Sheet1.getCell(3, count)
Cell Field5 = Sheet1.getCell(4, count)
log.info("Count is "+count.toString() + "SKU: "+ Field1.getContents() + "Name:  " + Field2.getContents()  + "Attribute ID:  " + Field3.getContents()  + "Price:  " + Field4.getContents()  + "Product Type:  " + Field5.getContents())
//Close the workbook
WorkBook1.close()

//Copy the data from excel into the Properties that we have declared 
PropertiesTestStep.setPropertyValue("SKU", Field1.getContents())
PropertiesTestStep.setPropertyValue("Name", Field2.getContents())
PropertiesTestStep.setPropertyValue("AttrID", Field3.getContents())
PropertiesTestStep.setPropertyValue("Price", Field4.getContents())
PropertiesTestStep.setPropertyValue("TypeID", Field5.getContents())
PropertiesTestStep.setPropertyValue("counter", count.toString())

//check the counter value is less than total no of rows. 
if (count == PropertiesTestStep.getPropertyValue("total").toInteger() - 1)
	PropertiesTestStep.setPropertyValue("end", "true")

//def testCaseName = 'TestCase_009'
//def testStepName = 'CatalogProduct'
//def response = context.testCase.testSuite.testCases[testCaseName].testSteps[testStepName].testRequest.responseContent
// Create the XmlHolder object for the response of the Request 1 request
def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context ) 
def prj = testRunner.testCase.testSuite.project.workspace.getProjectByName("ProjectName")
tCase = prj.testSuites['TestSuiteName'].testCases['TestCaseName']
tStep = tCase.getTestStepByName("TestStepName")
def holder = groovyUtils.getXmlHolder( "tCase#tStep#Response" )
// Iterate through item nodes in the response message
for( item in holder.getNodeValues( "//*.catalogProductRepositoryV1GetListResponse/result/items/item[1]/sku" ))
    log.info "Item : [$item]"
//log.info response

